    [],nt"revision_timestamp": "2015-09-26T23:16:04.965666",nt"name": "2006-em300-multibeam-sonar-data-from-cruise-hiialakai-hi-06-04-pacific-remote-island-areas",nt"isopen":
    false,nt"url": null,nt"notes": "EM300 multibeam data were collected in
    15 March to 8 April 2006 aboard NOAA Ship Hi'ialakai at Jarvis Island, Palmyra Island,
    and Kingman Island in the Central Pacific during cruise HI-06-04. These multibeam
    data were collected using SAIC ISS-2000 software in the Generic Sensor Format and
    processed using SABER editing software. Surface sound velocity values were supplied
    by a Seabird SBE-45 MicroTSG and a SBE-38 remote temperature probe. Sound velocity
    corrections from a Seabird 911 CTD sensor and motion corrections from a POS-MV vertical
    reference were applied to the data in real time. Predicted tides were applied to
    the data in real time. At Jarvis Island, Hilo (1617760) predicted tides were used
    with a +2.0 time corrector and a range ratio of 1.10. At Palmyra and Kingman, Honolulu
    (1612340) predicted tides were used with a +1 hr 19 min time corrector and a range
    ratio of 0.56. Horizontal accuracy is 20m (no differential GPS correctors applied),
    vertical accuracy is depth dependent (~1% of water depth), WGS84 datum. These data
    are not to be used for navigation. Depths mapped range from 20 to 3500 m. Concurrent
    mapping was done by the R/V AHI in water depths ranging from 10-250 m with the data
    set being AHI-06-04; metadata for AHI-06-04 are submitted separately.",nt"license_title":
